import React from 'react';
 import {BrowserRouter,Switch,Route} from 'react';

import App from '../App';
import AboutMe from './AboutMe';
const Router = () =>(
<BrowserRouter>
<Switch>
    <Route path="/" component={App} exact />
    <Route path="/AboutMe/" component={AboutMe} />
</Switch>
</BrowserRouter>
);

export default Router;
